// 📁 BRAMHAND/frontend/src/pages/Brahma.jsx
import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { useDropzone } from 'react-dropzone';
import axios from 'axios';

export default function Brahma() {
  const navigate = useNavigate();
  const [fileData, setFileData] = useState([]);
  const [columns, setColumns] = useState([]);
  const [stats, setStats] = useState({ rows: 0, cols: 0, missing: 0 });
  const [selectedFile, setSelectedFile] = useState(null);

  const onDrop = (acceptedFiles) => {
    const file = acceptedFiles[0];
    setSelectedFile(file);

    const reader = new FileReader();

    reader.onload = (e) => {
      const text = e.target.result;
      const preview = text.split('\n').slice(0, 5).map(line => line.split(','));
      setFileData(preview);
      setColumns(preview[0]);
      calculateStats(preview);
    };

    reader.readAsText(file);
  };

  const calculateStats = (data) => {
    const rows = data.length;
    const cols = data[0] ? data[0].length : 0;
    let missing = 0;
    data.forEach(row => {
      row.forEach(val => {
        if (val === null || val === '' || val === undefined) missing++;
      });
    });
    setStats({ rows, cols, missing });
  };

  const { getRootProps, getInputProps, isDragActive } = useDropzone({ onDrop });

  const sendFileToBackend = async () => {
    if (!selectedFile) {
      alert('Please upload a file first.');
      return;
    }

    try {
      const formData = new FormData();
      formData.append('file', selectedFile);

      const response = await axios.post('http://localhost:5000/upload', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      });

      console.log('🚀 Cosmic Metrics Received:', response.data);

      // Navigate to Vishnu with backend purified data
      navigate('/vishnu', { state: { dataFromBackend: response.data } });

    } catch (error) {
      console.error('❌ Error sending file to backend:', error);
      alert('Failed to purify karma. Please try again.');
    }
  };

  return (
    <div className="min-h-screen bg-gradient-to-b from-[#0f0c29] via-[#302b63] to-[#0f0c29] flex flex-col items-center justify-center p-6 text-white">
      <h1 className="text-5xl font-bold mb-8 animate-pulse">🪔 Brahma's Chamber of Creation</h1>

      <div
        {...getRootProps()}
        className="w-full max-w-3xl p-10 border-4 border-dashed border-yellow-400 rounded-xl bg-[#1a1a2e] flex flex-col items-center justify-center cursor-pointer hover:bg-[#16213e] transition"
      >
        <input {...getInputProps()} />
        {isDragActive ? (
          <p className="text-lg">Drop your sacred file here... 📂</p>
        ) : (
          <p className="text-lg">Drag & drop a file here, or click to select (CSV, Excel, JSON)</p>
        )}
      </div>

      {fileData.length > 0 && (
        <div className="mt-10 w-full max-w-4xl">
          <h2 className="text-2xl font-semibold mb-4">📜 Preview of Your Karma Data:</h2>
          <div className="overflow-x-auto">
            <table className="min-w-full table-auto text-sm text-gray-300">
              <thead>
                <tr>
                  {columns.map((col, index) => (
                    <th key={index} className="border px-4 py-2">{col}</th>
                  ))}
                </tr>
              </thead>
              <tbody>
                {fileData.slice(1, 5).map((row, rowIndex) => (
                  <tr key={rowIndex}>
                    {row.map((cell, colIndex) => (
                      <td key={colIndex} className="border px-4 py-2">
                        {cell !== undefined ? cell : '-'}
                      </td>
                    ))}
                  </tr>
                ))}
              </tbody>
            </table>
          </div>

          <div className="mt-6 space-y-2">
            <p>🧮 Rows: {stats.rows}</p>
            <p>📏 Columns: {stats.cols}</p>
            <p>⚠️ Missing Values: {stats.missing}</p>
          </div>

          <button
            onClick={sendFileToBackend}
            className="mt-8 bg-yellow-400 hover:bg-yellow-500 text-black font-bold py-3 px-8 rounded-full transition transform hover:scale-105"
          >
            ✨ Begin Karma Purification ✨
          </button>
        </div>
      )}
    </div>
  );
}
